// Dependencies.
import { Link } from "react-scroll";
import React from 'react';

// Component 'Navbar'.
function Navbar() {
    return (
        // Navbar Container.
        <nav class="navbar navbar-expand-lg navbar-dark bg-steel">
            {/* Navbar Brand */}
            <a class="navbar-brand" href="/">Shawn Luther</a>
            {/* Mobile Collapse Icon (Hamburger) */}
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText"
                aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                {/* Hamburger Icon */}
                <span class="navbar-toggler-icon"></span>
            </button>
            {/* Navbar Mobile Collapse Container */}
            <div class="collapse navbar-collapse" id="navbarText">
                {/* Navbar Unordered Link List Container */}
                <ul class="navbar-nav text-right">
                    {/* Item #1 - 'About Me' */}
                    <li class="nav-item active">
                        <a class="nav-link" href="#">About Me
                            <span class="sr-only">(current)</span>
                        </a>
                    </li>
                    {/* Item #2 - 'Skills & Projects' */}
                    <li class="nav-item">
                        <a class="nav-link" href="#">Skills & Projects</a>
                    </li>
                    {/* Item #3 - 'Contact' */}
                    <li class="nav-item">
                        <a class="nav-link" href="#">Contact</a>
                    </li>
                </ul>
            </div>
            <ul class="navbar-nav nav-flex-icons">
                <li class="nav-item">
                    <a class="nav-link waves-effect waves-light">
                        <i class="fab fa-twitter"></i>
                    </a>
                </li>
                <li class="nav-item">
                    <a class="nav-link waves-effect waves-light">
                        <i class="fab fa-google-plus-g"></i>
                    </a>
                </li>
                <li class="nav-item dropdown">
                    <a class="nav-link dropdown-toggle waves-effect waves-light" id="navbarDropdownMenuLink-333" data-toggle="dropdown" aria-haspopup="true" aria-expanded="true">
                        <i class="fas fa-user"></i>
                    </a>
                    <div class="dropdown-menu dropdown-menu-right dropdown-default" aria-labelledby="navbarDropdownMenuLink-333">
                        <a class="dropdown-item waves-effect waves-light" href="#">Action</a>
                        <a class="dropdown-item waves-effect waves-light" href="#">Another action</a>
                        <a class="dropdown-item waves-effect waves-light" href="#">Something else here</a>
                    </div>
                </li>
            </ul>
        </nav>
    );
}

// Do export.
export default Navbar;
